import React from "react";

function NavBar() {
  return (
    <nav className="nav-bar">
        <ul className="nav-bar-list">
            <li className="nav-bar-item">
                <a href="#">Home</a>
            </li>
            <li className="nav-bar-item">
                <a href="#">About</a>
            </li>
            <li className="nav-bar-item">
                <a href="#">Portfolio</a>
            </li>
        </ul>
    </nav>
  );
}

export default NavBar;
